import React from 'react';

function Header() {
  return (
    <header className="App-header">
      <h1>Sam Newman's Portfolio</h1>
      <p>Welcome to my personal portfolio! Here you can find my projects, classes, and more about me.</p>
    </header>
  );
}

export default Header;
